/**
 *  PlasmaGigaAppTheme.OnDark
 */
@Composable
public fun PlasmaGigaAppTheme.OnDark(
    isDark: Boolean = isSystemInDarkTheme(),
    content: @Composable
    () -> Unit,
) {
    val colors = if (isDark) {
        darkOnDarkColors
    } else {
        lightOnDarkColors
    }
    val gradients = if (isDark) {
        darkOnDarkGradients
    } else {
        lightOnDarkGradients
    }
    PlasmaGigaAppTheme(
        colors = colors,
        gradients = gradients,
        content = content,
    )
}
